import React, {Suspense} from 'react'
import {useImage} from 'react-image'
 
const Image = ({source}) => {
    console.log({source});
  const {src} = useImage({
    srcList: "https://10.0.0.5:8001/media/images/man-excer1.jpg",
  })
 
  return <img src={[src, source]} style={{width:'100%'}}/>
}
 
export default function MyComponent() {
  return (
    <Suspense fallback={<div>Loading...</div>}>
      <Image />
    </Suspense>
  )
}
